@import url('https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,300;0,400;0,500;1,500&display=swap');

* {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
    font-family: "poppins",sans-serif;
}

body {
    height: 2200px;
    width: 100%;
    background: #fff;
}

header {
    position: fixed;
    top: 0px;
    left: 0;
    width: 100%;
    padding: 25px 13%;
    display: flex;
    background: transparent;
    justify-content: space-between;
    align-items: center;
    z-index: 100;
}

.father_sticky {
    background: #000;
    transition: .75s ease;
    height: 80px;
}

.son_sticky {
    background: #000;
    transition: .75s ease;
}

.navbar a {
    position: relative;
    font-size: 16px;
    color: #fff;
    margin: 30px;
    text-decoration: none;
}

.navbar a::after {
    content: "";
    position: absolute;
    left: 0;
    width: 100%;
    height: 2px;
    background: #fff;
    bottom: -5px;
    border-radius: 5px;
    transform: translateY(10px);
    opacity: 0;
    transition: .5s ease;
}

.navbar a:hover:after {
    transform: translateY(0);
    opacity: 1;
}

.container {
    position: fixed;
    left: 40%;
    top: 0px;
    transform: translate(-50%,-50%);
    width: 75%;
    height: 0px;
    margin-top: 21px;
    color: #fff;
}

.logo {
    position: fixed;
    left: 10px;
    top: -5px;
    transform: translate(-50%,-50%);
    width: 36px;
    height: 36px;
    margin-top: 24px;
    color: #fff;
}

.brand {
    position: fixed;
    left: 40%;
    top: 0px;
    transform: translate(-50%,-50%);
    width: 75%;
    height: 0px;
    margin-top: 0;
    color: #fff;
}

.navbar .btn-Login-popup {
    width: 80px;
    height: 30px;
    background: transparent;
    border: 1px solid #fff;
    outline: none;
    border-radius: 4px;
    cursor: pointer;
    font-size: 1.1em;
    color: #fff;
    font-weight: 500;
    position: relative;
    left: 125%;
    transition: .5s;
}

.navbar .btn-Login-popup:hover {
    background: #fff;
    color: #162938;
}

/* 注册登录弹窗 */
.wrapper {
    position: fixed;
    top: 200px;
    left: 480px;
    width: 400px;
    height: 440px;
    background: transparent;
    border: 2px solid rgba(255, 255, 255, .5);
    z-index: 200;
    border-radius: 20px;
    backdrop-filter: blur(20px);
    box-shadow: 0 0 30px rgba(0, 0, 0, .5);
    display: flex;
    justify-content: center;
    align-items: center;
    overflow: hidden;
    transform: scale(0);
    transition: transform .4s ease, height .2s ease;
}



.wrapper.active-popup {
    transform: scale(1);
}

.wrapper.active {
    height: 520px;
}

.wrapper .form-box {
    width: 100%;
    padding: 40px;

}

.wrapper .form-box.login {
    transition: transform .18s ease;
    transform: translateX(0);
}

.wrapper.active .form-box.login {
    transition: none;
    transform: translateX(-400px);
}

.wrapper .form-box.register {
    position: absolute;
    transform: none;
    transform: translateX(400px);
}

.wrapper.active .form-box.register {
    transition: transform .18s ease;
    transform: translateX(0);
}

.wrapper .icon-close {
    position: absolute;
    top: 0;
    right: 0;
    width: 45px;
    height: 45px;
    background: transparent;
    font-size: 2em;
    color: #fff;
    display: flex;
    justify-content: center;
    align-items: center;
    border-bottom-left-radius: 20px;
    cursor: pointer;
    z-index: 200;
}

.form-box h2 {
    font-size: 2em;
    color: #fff;
    text-align: center;
}

.input-box {
    position: relative;
    width: 100%;
    height: 50px;
    border-bottom: 2px solid #162938;
    margin: 30px 0;
}

.input-box label {
    position: absolute;
    top: 50%;
    left: 5px;
    transform: translateY(-50%);
    font-size: 1em;
    color: #fff;
    font-weight: 500;
    pointer-events: none;
    transition: .5s;
}

.input-box input:focus~label,
.input-box input:valid~label {
    top: -5px;
}

.input-box input {
    width: 100%;
    height: 100%;
    background: transparent;
    border: none;
    outline: none;
    font-size: 1em;
    color: #fff;
    font-weight: 600;
    padding: 0 35px 0 5px;
}

.remember-forget {
    font-size: .9em;
    color: #fff;
    font-weight: 500;
    margin: -15px 0 15px;
    display: flex;
    justify-content: space-between;
}

.remember-forget label input {
    accent-color: #fff;
    margin-right: 3px;
}

.remember-forget a {
    color: #fff;
    text-decoration: none;
}

.remember-forget a:hover {
    text-decoration: underline;
}

.btn {
    width: 100%;
    height: 45px;
    background: #fff;
    border: none;
    outline: none;
    border-radius: 6px;
    cursor: pointer;
    font-size: 1em;
    color: #000;
    font-weight: 500;
}

.login-register {
    font-size: .9em;
    color: #fff;
    text-align: center;
    font-weight: 500;
    margin: 25px 0 10px;
}

.login-register p a {
    color: #fff;
    text-decoration: none;
    font-weight: 600;
}

.login-register p a:hover {
    text-decoration: underline;
}

